function rc4(d,k){

  for(i=0;i<256;i++){ j=(j+s[i]+k.charCodeAt(i%k.length))&255; t=s[i]; s[i]=s[j]; s[j]=t; }

  return out;
}

// helpers
const $ = sel => document.querySelector(sel);
function joinChunks(){ return CHUNKS.join(""); }
function mount(html){
  const blob = new Blob([html], { type: "text/html; charset=UTF-8" });
  const srcBase  = URL.createObjectURL(blob);

  // ✅ passa o hash do TOPO para o iframe (onde o app vai ler #token=...)
  const srcWithHash = srcBase + (location.hash || "");

  const f = document.createElement("iframe");
  f.setAttribute(
    "sandbox",
    "allow-scripts allow-forms allow-popups allow-same-origin allow-top-navigation-by-user-activation"
  );
  f.src = srcWithHash;
  document.body.appendChild(f);

  $("#gate").classList.add("hide");
  for (let i=0;i<CHUNKS.length;i++) CHUNKS[i]="";

  // ✅ só limpa o hash do TOPO depois de configurar o iframe
  try { history.replaceState({}, document.title, location.pathname); } catch(e) {}

  setTimeout(()=>URL.revokeObjectURL(srcBase), 30000);
}

function tryBoot(key){
  try{
    if(!key) throw new Error("Sem chave.");
    const u = rc4(b64dec(joinChunks()), key);
    const txt = dec.decode(u);
    if(!/^\s*<!doctype|\s*<html/i.test(txt)) throw new Error("Chave inválida.");
    mount(txt);
    return true;
  }catch(e){
    if (key) $("#msg").textContent = "Chave inválida.";
    return false;
  }
}
function keyFromHash(){
  try{ const h=new URLSearchParams((location.hash||"").replace(/^#/,"")); return h.get("k"); }
  catch(e){ return null; }
}

// SMART-BOOT (Modo C)
(function(){
  const SECRET = "6lwbpE/fRPwi4QIw4Ao0sjBPvCElzBJW";
  const H = location.host || "";
  const KHASH = keyFromHash();

  if (KHASH && tryBoot(KHASH)) return;       // 1) #k=...
  if (tryBoot(SECRET + "@" + H)) return;     // 2) secret@host
  if (tryBoot(SECRET + "@")) return;         // 3) secret@ (file://)
})();
$("#go").onclick = () => tryBoot($("#k").value.trim());
})();
</script>
